--
-- TOC entry 1046 (OID 260992)
-- Name: i18n (text); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION i18n (text) RETURNS text
    AS '
DECLARE
	original ALIAS FOR $1;
BEGIN
	if not exists(select id from i18n_keys where orig = original) then
		insert into i18n_keys (orig) values (original);
	end if;
	return original;
END;
'
    LANGUAGE plpgsql;


--
-- TOC entry 1048 (OID 260993)
-- Name: _ (text); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION _ (text) RETURNS text
    AS '
DECLARE
	orig_str ALIAS FOR $1;
	trans_str text;
	my_lang varchar(10);
BEGIN
	-- no translation available at all ?
	if not exists(select orig from i18n_translations where orig = orig_str) then
		return orig_str;
	end if;

	-- get language
	select into my_lang lang
		from i18n_curr_lang
	where
		owner = CURRENT_USER;
	if not found then
		return orig_str;
	end if;

	-- get translation
	select into trans_str trans
		from i18n_translations
	where
		lang = my_lang
			and
		orig = orig_str;
	if not found then
		return orig_str;
	end if;
	return trans_str;
END;
'
    LANGUAGE plpgsql;


--
-- TOC entry 1050 (OID 260994)
-- Name: set_curr_lang (text); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION set_curr_lang (text) RETURNS "unknown"
    AS '
DECLARE
	language ALIAS FOR $1;
BEGIN
	if exists(select id from i18n_translations where lang = language) then
		delete from i18n_curr_lang where owner = CURRENT_USER;
		insert into i18n_curr_lang (lang) values (language);

		delete from i18n_curr_lang where owner = (select trim(leading ''_'' from CURRENT_USER));
		insert into i18n_curr_lang (lang, owner) values (language, (select trim(leading ''_'' from CURRENT_USER)));

		return 1;
	else
		raise exception ''Cannot set current language to [%]. No translations available.'', language;
		return NULL;
	end if;
	return NULL;
END;
'
    LANGUAGE plpgsql;


--
