-- TOC entry 1058 (OID 261067)
-- Name: log_x_db_fk_violation (integer, text, text, text); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION log_x_db_fk_violation (integer, text, text, text) RETURNS "unknown"
    AS '
DECLARE
	fk_def_id alias for $1;
	viol_pk alias for $2;
	viol_val alias for $3;
	viol_comment alias for $4;
	dummy RECORD;
BEGIN
	-- violation already reported ?
	select 1 into dummy
	from
		x_db_fk_violation viol
	where
		viol.id_fk_def = fk_def_id
			and
		viol.fk_table_pk = viol_pk
			and
		viol.fk_value = viol_val
	;
	-- no
	if not found then
		insert into x_db_fk_violation(id_fk_def, fk_table_pk, fk_value, description)
			values (fk_def_id, viol_pk, viol_val, viol_comment);
	end if;
	return true;
END;'
    LANGUAGE plpgsql;


