--
-- TOC entry 1066 (OID 261994)
-- Name: find_state (text, text); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION find_state (text, text) RETURNS text
    AS '
DECLARE
	pcode ALIAS FOR $1;	-- post code
	ccode ALIAS FOR $2;	-- country code
	s RECORD;
	retval text := NULL;
BEGIN
	SELECT INTO s * FROM state WHERE
		id = (SELECT id_state from urb where postcode like pcode||''%'' limit 1)
			AND
		country=ccode;
	IF FOUND THEN
		retval := s.code;
	END IF;
	RETURN retval;
END;'
    LANGUAGE plpgsql;


--
-- TOC entry 1067 (OID 261995)
-- Name: find_street (text, integer); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION find_street (text, integer) RETURNS integer
    AS '
DECLARE
	s_name ALIAS FOR $1;
	s_id_urb ALIAS FOR $2;
	s RECORD;
BEGIN
	SELECT INTO s * FROM street WHERE
		name = s_name
			AND
		id_urb = s_id_urb;
	IF FOUND THEN
		RETURN s.id;
	ELSE
		INSERT INTO street (id_urb, name) VALUES (s_id_urb, s_name);
		RETURN currval (''street_id_seq'');
	END IF;
END;'
    LANGUAGE plpgsql;


--
-- TOC entry 1068 (OID 261996)
-- Name: find_or_create_state (text, text); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION find_or_create_state (text, text) RETURNS integer
    AS '
DECLARE
        s_code ALIAS FOR $1;
        s_country ALIAS FOR $2;
        s RECORD;
BEGIN
        SELECT INTO s * FROM state
	WHERE code = s_code
	AND country = s_country;
        IF FOUND THEN
           RETURN s.id;
        ELSE
           INSERT INTO state (code, country) VALUES (s_code, s_country);
           RETURN currval (''state_id_seq'');
        END IF;
END;'
    LANGUAGE plpgsql;


--
-- TOC entry 1069 (OID 261997)
-- Name: find_urb (text, text, text, text); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION find_urb (text, text, text, text) RETURNS integer
    AS '
DECLARE
	u_country ALIAS FOR $1;
	u_state ALIAS FOR $2;
	u_postcode ALIAS FOR $3;
	u_name ALIAS FOR $4;
	u RECORD;
	state_code INTEGER;
BEGIN
	state_code = find_or_create_state(u_state, u_country);
	SELECT INTO u *
	FROM urb
	WHERE
		id_state = state_code
			AND
		postcode = u_postcode
			AND
		name = u_name;

	IF FOUND THEN
		RETURN u.id;
	ELSE
		INSERT INTO urb (id_state, postcode, name)
		VALUES (state_code, u_postcode, u_name);
		RETURN currval (''urb_id_seq'');
	END IF;
END;'
    LANGUAGE plpgsql;


