-- Name: f_announce_clin_item_mod (); Type: FUNCTION; Schema: public; Owner: gm-dbowner
--

CREATE FUNCTION f_announce_clin_item_mod () RETURNS "trigger"
    AS '
declare
	episode_id integer;
	patient_id integer;
begin
	-- get episode ID
	if TG_OP = ''DELETE'' then
		episode_id := OLD.id_episode;
	else
		episode_id := NEW.id_episode;
	end if;
	-- track back to patient ID
	select into patient_id id_patient
		from v_pat_episodes vpep
		where vpep.id_episode = episode_id
		limit 1;
	-- now, execute() the NOTIFY
	execute ''notify "item_change_db:'' || patient_id || ''"'';
	return NULL;
end;
'
    LANGUAGE plpgsql;


