-- TOC entry 1190 (OID 282330)
-- Name: test (text); Type: FUNCTION; Schema: public; Owner: sjtan
--

CREATE FUNCTION test (text) RETURNS text
    AS '
declare
	curs1 refcursor;
	src_qry alias for $1;
	query text;
	first boolean;
	fields TEXT;
	values TEXT;
	row RECORD;
	name TEXT;
BEGIN
	first := true;
	for row in select tablename from pg_tables where tablename = ''test1''  LOOP
		first := false;
	end loop;
	
	if not first then
		drop table test1;
	end if;

	first := true;
 	query := ''create temp table t1  '';
	fields := '''';
	values := '''';
	
	open curs1 for execute src_qry;

	loop
		fetch curs1 into name;
		exit when  not FOUND ;
		if not first then
			fields := fields || '','';
		end if;

		fields := fields || name || '' text '';
		first := false;

	end loop;

	query := query || ''('' || fields || '')'' ;

	

	return query;
end;'
    LANGUAGE plpgsql;


--
-- TOC entry 1191 (OID 282378)
-- Name: make_crosstab1 (text); Type: FUNCTION; Schema: public; Owner: sjtan
--

CREATE FUNCTION make_crosstab1 (text) RETURNS text
    AS '
declare
	curs1 refcursor;
	src_qry alias for $1;
	query text;
	first boolean;
	fields TEXT;
	values TEXT;
	row RECORD;
	name TEXT;
	tablename TEXT;
	
BEGIN
	tablename :=  btrim( split_part(split_part(src_qry, '' from '', 2), '' '', 1) );
	first := true;
	for row in execute ''select tablename from pg_tables where tablename = ''''crosstab_'' || tablename  || '''''''' LOOP
		first := false;
	end loop;
	
	if not first then
		execute ''drop table crosstab_'' || tablename;
	end if;

	first := true;
 	query := ''create temp table crosstab_'' || tablename;
	fields := '' rowid integer, '';
	values := '''';
	
	open curs1 for execute src_qry;

	loop
		fetch curs1 into name;
		exit when  not FOUND ;
		if not first then
			fields := fields || '','';
		end if;

		fields := fields || name || '' text default null '';
		first := false;

	end loop;

	query := query || '' ('' || fields || '')'' ;

	execute query;

	return query;	
end;'
    LANGUAGE plpgsql;


--
-- TOC entry 1192 (OID 282426)
-- Name: make_crosstab2 (text, text); Type: FUNCTION; Schema: public; Owner: sjtan
--

CREATE FUNCTION make_crosstab2 (text, text) RETURNS text
    AS '
declare

	value_qry alias for $1;
	category_qry alias for $2;
	create_val_qry text;
	crosstab text;
	curs1	refcursor;
	curs2 	refcursor;
	row	record;
	category text;
	value	text;
	a_rowid integer;
	dummy_id integer;

begin
	create_val_qry := make_crosstab1(category_qry);

	crosstab = split_part( create_val_qry, '' '', 4);

	open curs1 for execute value_qry;
	loop
		fetch curs1 into a_rowid, category, value;
		exit when not found;

		open curs2 for execute ''select rowid from '' || crosstab || '' c where c.rowid = '' || text(a_rowid);
		fetch curs2 into dummy_id;
	
		if found then
			execute ''update '' || crosstab||'' set '' || category || ''= '''''' || value || '''''' where rowid = '' || a_rowid ;
		else
			execute ''insert into ''||crosstab||'' ( rowid, '' || category ||'') values ( '' || a_rowid || '', ''''''|| value || '''''' ) '';

		end if;
		close curs2;
	end loop;
	return crosstab;
end;
'
    LANGUAGE plpgsql;


