--
-- TOC entry 1196 (OID 282442)
-- Name: add_name (integer, text, text, boolean); Type: FUNCTION; Schema: public; Owner: sjtan
--

CREATE FUNCTION add_name (integer, text, text, boolean) RETURNS integer
    AS '
DECLARE
	identity_id alias for $1;
	first alias for $2;
	last alias for $3;
	activated alias for $4;

	n_rec record;
BEGIN
	-- name already there for this identity ?
	select into n_rec * from names where id_identity = identity_id and firstnames = first and lastnames = last;
	if FOUND then
		update names set active = activated where id = n_rec.id;
		if FOUND then
			return n_rec.id;
		end if;
		return NULL;
	end if;
	-- no, insert new name
	insert into names (id_identity, firstnames, lastnames, active) values (identity_id, first, last, activated);
	if FOUND then
		return n_rec.id;
	end if;
	return NULL;
END;'
    LANGUAGE plpgsql;


