--

CREATE RULE r_insert_basic_person AS ON INSERT TO v_basic_person DO INSTEAD (INSERT INTO identity (pupic, gender, dob, cob, title) VALUES (new_pupic(), new.gender, new.dob, new.cob, new.title); INSERT INTO "names" (firstnames, lastnames, id_identity) VALUES (new.firstnames, new.lastnames, currval('identity_id_seq'::text)); );


--
-- TOC entry 1571 (OID 261946)
-- Name: r_update_basic_person1; Type: RULE; Schema: public; Owner: gm-dbowner
--

CREATE RULE r_update_basic_person1 AS ON UPDATE TO v_basic_person WHERE (((new.firstnames <> old.firstnames) OR (new.lastnames <> old.lastnames)) OR (new.title <> old.title)) DO INSTEAD INSERT INTO "names" (firstnames, lastnames, id_identity, active) VALUES (new.firstnames, new.lastnames, new.i_id, true);


--
-- TOC entry 1572 (OID 261947)
-- Name: r_update_basic_person2; Type: RULE; Schema: public; Owner: gm-dbowner
--

CREATE RULE r_update_basic_person2 AS ON UPDATE TO v_basic_person DO INSTEAD UPDATE identity SET dob = new.dob, cob = new.cob, gender = new.gender WHERE (identity.id = new.i_id);


--
-- TOC entry 1573 (OID 261948)
-- Name: r_delete_basic_person; Type: RULE; Schema: public; Owner: gm-dbowner
--

CREATE RULE r_delete_basic_person AS ON DELETE TO v_basic_person DO INSTEAD DELETE FROM identity WHERE (identity.id = old.i_id);


--
-- TOC entry 1574 (OID 261998)
-- Name: insert_address; Type: RULE; Schema: public; Owner: gm-dbowner
--

CREATE RULE insert_address AS ON INSERT TO v_basic_address DO INSTEAD INSERT INTO address (id_street, number, addendum) VALUES (find_street(new.street, find_urb((new.country)::text, (new.state)::text, (new.postcode)::text, new.city)), new.number, new.street2);


--
-- TOC entry 1575 (OID 261999)
-- Name: delete_address; Type: RULE; Schema: public; Owner: gm-dbowner
--

CREATE RULE delete_address AS ON DELETE TO v_basic_address DO INSTEAD DELETE FROM address WHERE (address.id = old.addr_id);


--
-- TOC entry 1576 (OID 262000)
-- Name: update_address; Type: RULE; Schema: public; Owner: gm-dbowner
--

CREATE RULE update_address AS ON UPDATE TO v_basic_address DO INSTEAD UPDATE address SET number = new.number, addendum = new.street2, id_street = find_street(new.street, (SELECT urb.id FROM urb, state WHERE (((((urb.name = new.city) AND (urb.postcode = new.postcode)) AND (urb.id_state = state.id)) AND (state.code = new.state)) AND (state.country = new.country)))) WHERE (address.id = old.addr_id);


